from collections import defaultdict

class Solution:
    def maxTargetNodes(self, edges1: list[list[int]], edges2: list[list[int]], k: int) -> list[int]:
        n = max(max(edge) for edge in edges1) + 1
        m = max(max(edge) for edge in edges2) + 1

        #edgesOfTree1 = {node: {depth: [targets]}}
        def get_neighbour_nodes(edges):
            neighbour_nodes = defaultdict(list)
            for edge in edges:
                from_ = edge[0]
                to_ = edge[1]
                neighbour_nodes[from_].append(to_)
                neighbour_nodes[to_].append(from_)
            return neighbour_nodes

        neighbour_nodes_tree1 = get_neighbour_nodes(edges1)
        neighbour_nodes_tree2 = get_neighbour_nodes(edges2)

        def helper(start_node, node, neighbour_nodes, k, level=0, result=None, visited=None):
            if result is None:
                result = defaultdict(list)
                visited = set()

            if k < 0:
                return

            if node not in visited:
                result[level].append(node)
                visited.add(node)
            else:
                return

            for next_node in neighbour_nodes[node]:
                helper(start_node, next_node, neighbour_nodes, k - 1, level + 1, result, visited)

            return result

        edges_of_tree1 = {}
        for node in range(n):
            edges_of_tree1[node] = helper(node, node, neighbour_nodes_tree1, k)
        edges_of_tree2 = {}
        for node in range(m):
            edges_of_tree2[node] = helper(node, node, neighbour_nodes_tree2, k - 1)

        targets_from_tree2 = 0
        for node2 in range(m):
            counter = 0
            levels = edges_of_tree2[node2]
            if levels:
                for level in levels:
                    counter += len(levels[level])
                targets_from_tree2 = max(targets_from_tree2, counter)

        answer = []
        for node in range(n):
            targets = 0
            levels = edges_of_tree1[node]
            for level in levels:
                targets += len(levels[level])

            answer.append(targets + targets_from_tree2)

        return answer

